var $bm_rt;
var freq, amp, curWiggle, curPoint;
freq = -13;
amp = 5;
var oldPoints = points(time);
var newPoints = [oldPoints[0]];
for (var i = 1; i < oldPoints.length - 1; i++) {
    seedRandom(i);
    curWiggle = $bm_sub(position.wiggle(freq, amp), position.value);
    curPoint = oldPoints[i];
    newPoints.push($bm_sum(curPoint, curWiggle));
}
newPoints.push(oldPoints[$bm_sub(oldPoints.length, 1)]);
$bm_rt = createPath(newPoints, inTangents(time), outTangents(time), isClosed());
